import React from 'react';
import './css/nav_component.scss';
//import { Link } from 'react-router-dom';
import Master from '../Master/Master';
import {
    withNavigationContext,
    Link
  } from "react-awesome-slider/dist/navigation";

function NavComponent(props) {

    let textClass = props.theme == 'dark' ? 'nav_text_dark' : 'nav_text_light';


    return (
        <div className="nav_links_div">
            <ul className={`${textClass}`}>
                <li><Link href="/page-one">Portfolio</Link></li>
                <li><Link  href="/page-two" >Solutions</Link></li>
                <li><Link  href="/page-three" >Our Agency</Link></li>
                <li><a href="/page-four">Contact Us</a></li>
            </ul>
        </div>

    );

}


export default NavComponent;
